(55, 8, 'Mercedes C', 'Mam do oferowania zadbany egzemplarz Mercedesa C-Class z ekonomicznym silnikiem 1.6 BlueTEC. Samochd jest w peni sprawny, regularnie serwisowany  olej oraz wszystkie filtry wymieniane zawsze na czas. Auto wietnie sprawdza si zarwno w codziennym uytkowaniu, jak i podczas duszych wyjazdw, dziki bardzo niskiemu spalaniu.\n\n\n\nPojazd mona bez problemu sprawdzi w wybranym serwisie lub warsztacie.\n\nWystawiam faktur VAT, co moe by duym plusem dla kupujcych z firm.\n\n\n\nSamochd dostpny jest do obejrzenia w Tczewie (83-110).\n\n\n\nZachcam do kontaktu oraz umwienia si na jazd prbn!', 555555.00, 77, 692, 2023, 'WF0VXXGCEVFU32503', 'GD 909YZ', '2023-07-21', 30000, 250, '4x4', 5, NULL, 'Niebieski', 1, 'uzywany', 0, 1, 1, 1, 1, 'benzyna', 'automatyczna', 3.00, 'aktywne', '{\"abs\": true, \"led\": true, \"klimatyzacja\": true}', '2025-12-09 21:57:51', '2025-12-10 21:19:46'),
(56, 8, 'Abarth 500', 'Auper abarth', 50000.00, 1, 3, 2024, 'WF0VXXGCEVFU32501', 'GD 909YO', '2024-05-16', 10, 2000, 'przedni', 3, NULL, 'Czarny', 0, 'uzywany', 0, 0, 0, 0, 0, 'benzyna', 'manualna', 2.00, 'aktywne', NULL, '2025-12-09 22:18:20', '2025-12-10 21:51:10'),
(58, 3, 'Honda Accord', 'Witam wszystkich zainteresowanych, Sprzedam mj prywatny samochd marki Honda Accord w wersji wyposaeniowej Executive. Auto zostao zakupione w Danii w 2017 roku z przebiegiem 180 tys km od Duczyka - pierwszego waciciela. W 2019 zdecydowaem si na rejestracj w Polsce. Od tego czasu suyo jako trzeci pojazd w rodzinie i przez 6 lat pokonao zaledwie 33 tys kilometrw. Samochd zosta wyprodukowany pod koniec 2009 roku i zosta zarejestrowany 23 grudnia (podobno jako prezent gwiazdkowy). Auto wyposaone jest w niezawodny i wyjtkowo ekonomiczny silnik 2,2 i-DTEC - przez wielu uwaany za najbardziej odpowiedni jednostk napdow dla tego samochodu. Silnik posiada moc 150 koni mechanicznych i 350 Nm momentu obrotowego dostpnego ju od 2000 obr/min. Auto jest wyjtkowo oszczdne  w krakowskich korkach spalanie nie przekracza 7 litrw na 100 km, co daje koszt poniej 40 PLN za 100 km. Utrzymujc rozsdn prdko samochd potrafi pali w trasie poniej 5 litr ropy na 100 km co daje jeden z najlepszych wynikw w tej klasie pojazdw. Przy takim spalaniu 65 litrowy zbiornik paliwa pozwala na pokonanie ponad 1300 km trasy bez tankowania! Auto jest naprawd zadbane  nikt z dotychczas ogldajcych nie mg uwierzy e auto przejechao 220 tys. km  poza naturalnym zuyciem fotela kierowcy, jasne skry jak i caa tapicerka samochodu s w doskonaym stanie. Samochd jest bardzo komfortowy, idealnie nadaje si do wyjazdu na narty, na ferie, po prostu na weekend albo na wakacje. Baganik pozwala bez problemu spakowa wszystkie bagae - co ciekawe Accord sedan mieci wicej ni wersja kombi. Kolor samochodu to granatowy metalic, wersja nadwozia: sedan. Samochd jest w bardzo bogatej wersji wyposaeniowej EXECUTIVE. Na wyposaeniu znajdziecie Pastwo m.in.: - dwustrefow automatyczn klimatyzacj z funkcj nawiewu z tyu, - 6 poduszek powietrznych (kierowcy, pasaera + 2 boczne oraz kurtyny przd-ty), - system z ABS oraz VSA (hondwowski odpowiednik ESP) z elektronicznym rozdziaem siy hamowania, - komputer pokadowy, - elektryczne szyby x 4, - szyberdach z rolet i funkcj uchylania, - elektrycznie regulowane i podgrzewane lusterka, - centralny zamek z pilota w kluczyku wraz z funkcj otwarcia tylko pokrywy baganika, - dwustopniowe podgrzewanie foteli, - elektrycznie regulowany na wysoko fotel kierowcy i pasaera wraz z podparciem czci ldwiowej oraz moliwoci pamici ustawie dla dwch uytkownikw, - halogenowe wiata przeciwmgowe, - radio CD + MP3 Premium Sound System wraz ze sterowaniem z kierownicy oraz kart kodow (niezbdn do uruchomienia radia po odpiciu akumulatora), - tempomat oraz regulator i ogranicznik prdkoci, - komputer pokadowy z dziennym licznikiem kilometrw, czasem podry, rednim zuyciem paliwa oraz informacj o iloci km do przejechania na pozostaym paliwie w baku, - kierownica regulowana w dwch paszczyznach, - koo kierownicy oraz gaka zmiany biegw pokryte skr, - wykoczenie deski rozdzielczej, kierownicy oraz gaki skrzyni biegw srebrnymi wstawkami, - podwietlany schowek oraz miejsca na nogi kierowcy i pasaera a take dodatkowe owietlenie oson przeciwsonecznych, - centralny podokietnik z przodu i z tyu, - kontrolka niezapitych pasw kierowcy jak i kadego z pasaerw, - 17-calowe oryginalne alufelgi wraz z wysokiej klasy oponami Michelin z przodu oraz Dunlop z tyu w bardzo dobrym stanie. Przebieg pojazdu (obecnie okoo 221.000 km) jest w 100% autentyczny, potwierdzony wpisami z przegldw w bazie CEPIK. Szczliwie ani razu pojazd nie by zatrzymany przez cae 6 lat przez policj. Dla wszystkich zainteresowanych podaj rwnie nr nadwozia VIN oraz duski numer rejestracyjny tak, aby w atwy sposb i bezpatnie mona byo sprawdzi autentyczno przebiegu (wystarczy na stronie https://www.nummerplade.net wprowadzi jedn z poniszych danych, aby zapozna si z raportami z dwch ostatnich obowizkowych przegldw rejestracyjnych): nr VIN: JHMCU35809C203615 duski nr rejestracyjny: EG39898 Wg mojej najlepszej wiedzy auto nigdy nie uczestniczyo w adnym wypadku. aden element nie nosi oznak korozji czy wyjtkowo nieostronego obchodzenia si z pojazdem. Oczywicie wystpuj naturalne objawy 16-letniego uywania auta, ale naprawd jest to kosmetyka (drobne rysy, pknicie zderzaka przy reflektorze). Samochd mia jednego uytkownika i posiadam do niego bezporedni kontakt. Obecnie samochd jest zarejestrowany i ubezpieczony prawie na rok (polisa koczy si we wrzeniu 2026)  mona przyjecha i bez problemu bezpiecznie wrci autem do domu, auto ma zimowe opony. Powany potencjalny nabywca moe liczy na przegld techniczny na kolejny rok - koczy si w tym miesicu ale nie mam problemu z tym eby w ramach ogldzin auto przeszo badanie techniczne - na mj koszt oczywicie. Jeeli macie Pastwo dosy ogldania powypadkowych samochodw z przekrconymi licznikami, zapraszam do mnie  tutaj nikt nic nie ukrywa i nie koloryzuje. Obecnie auto jest uytkowane na codzie przez kobiet, poza tym stoi bezpiecznie zaparkowane w garau podziemnym. Do samochodu posiadam dwa kluczyki oraz dowd rejestracyjny. Samochd by regularnie serwisowany w jednym z najlepszych maopolskich serwisw Hondy - Honda Team Kokotw. Regularnie wymieniaem olej (co max. 10 tys km lub co roku) oraz filtry. W samochodzie zmieniono w ubiegym roku przednie tarcze hamulcowe wraz z klockami oraz wymieniono zuyte czniki stabilizatora. Wtedy rwnie przeprowadzono regeneracj kompresora klimatyzacji w warsztacie specjalizujcym si w tego typu naprawach All Happy przy ul. Czarnogrskiej w Krakowie. W tym roku wymieniem rwnie skraplacz klimatyzacji i ponownie napeniem ukad. W aucie kady system dziaa, kada kontrolka wieci i kady przycisk jest podwietlany tak jak naley. Dbaem jak tylko mogem. Zachcam do ogldania na ywo w Krakowie. Cena 23.900 PLN do maej negocjacji tylko przy samochodzie', 22900.00, 43, 402, 2009, 'JHMCU35809C203615', 'KR2JY06', '2009-12-23', 200000, 150, 'przedni', 4, NULL, 'niebieski', 1, 'uzywany', 0, 1, 0, 1, 1, 'diesel', 'automatyczna', 2.20, 'aktywne', NULL, '2025-12-10 14:09:52', '2025-12-10 14:09:52'),
